    return (
        <Layout>
                <h1>My Dev Skills</h1>
                <Skills skills={props.data}/>
        </Layout>
    )
};

Index.getInitialProps = async () => {
    const res = await fetch('http://127.0.0.1:8000/api/v1/skill/')
    const data = await res.json()
    return {
        data
